import React from 'react';

class Table extends React.Component {
  constructor(props){
    super(props);
  }
  render() {
    return (
      <table>
        <tbody>
          <tr>
            <td className="1.1"></td>
            <td className="1.2"></td>
            <td className="1.3"></td>
          </tr>
          <tr>
            <td className="2.1"></td>
            <td className="2.2"></td>
            <td className="2.3"></td>
          </tr>
          <tr>
            <td className="3.1"></td>
            <td className="3.2"></td>
            <td className="3.3"></td>
          </tr>
        </tbody>
      </table >
    );
  }
}

export default Table;
